[411001]={ id=411001, name="狼精", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241001, activeNeedItem="", des="人界常见的小妖。身形细长，动作敏捷。因为自身体力和防御较差，所以喜欢和皮糙肉厚的猪妖同时出没。", icon="items/godWill/411001.png", spineName="spine/god/411001_langjing"}, 
[411002]={ id=411002, name="孙悟空", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=80, needAngry=3, cdTime=80000, skillID=241002, activeNeedItem="750002-30", des="齐天大圣孙悟空，唐僧的大徒弟，取经人之一。成佛后依然喜欢在人界玩耍，一直活跃在各地降妖除魔。", icon="items/godWill/411002.png", spineName="spine/god/411002_sunwukong"}, 
[411003]={ id=411003, name="高翠兰", Name1="", propertyType=1, grade=1, star=0, level=1, hp=90, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241003, activeNeedItem="750003-30", des="中原首富高家庄的大小姐。自小娇生惯养，却意外嫁给了花心的猪八戒。为了教训花心八戒，翠兰毅然决定修仙，可谓吃醋界的典范。", icon="items/godWill/411003.png", spineName="spine/god/411003_gaocuilan"}, 
[411004]={ id=411004, name="高太公", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=40, needAngry=2, cdTime=70000, skillID=241004, activeNeedItem="750004-30", des="中原第一首富，靠锻造发家。一手大锤使得出神入化。为人热情好客，只是爱女如命，若是得罪了高翠兰，别怪太公翻脸不认人……", icon="items/godWill/411004.png", spineName="spine/god/411004_gaotaigong"}, 
[411005]={ id=411005, name="白骨精", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=241005, activeNeedItem="750005-30", des="原本杀人无数，被孙悟空打败后逃到了女儿国，意外和国王成了挚友。现已不再乱吃人，只吃死囚，变相成了女儿国的新任刽子手。", icon="items/godWill/411005.png", spineName="spine/god/411005_baigujing"}, 
[411006]={ id=411006, name="清风明月", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241006, activeNeedItem="750006-30", des="看守五庄观的一对呆萌小仙童。乃是人参果修炼成精，天生灵力强大。但毕竟是植物所化，故而没有七情六欲，很难沟通。", icon="items/godWill/411006.png", spineName="spine/god/411006_qingfengmingyue"}, 
[411007]={ id=411007, name="嫦娥", Name1="", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241007, activeNeedItem="750007-30", des="自称天界第一美少女，对自己的容貌十分自信。唯一的缺点是有严重的被害妄想症，总认为所有人都在垂涎她的美色。", icon="items/godWill/411007.png", spineName="spine/god/411007_change"}, 
[411008]={ id=411008, name="小狼", Name1="狼精变色1", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=241001, activeNeedItem="", des="人界常见的小妖。身形细长，动作敏捷。因为自身体力和防御较差，所以喜欢和皮糙肉厚的猪妖同时出没。", icon="items/godWill/411008.png", spineName="spine/god/411008_langjing"}, 
