[411010]={ id=411010, name="高冷女王", Name1="白骨精变色", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=214005, activeNeedItem="", des="比白骨精还要厉害的白骨夫人。", icon="items/godWill/411005.png", spineName="spine/god/411010_baigujing"}, 
[411011]={ id=411011, name="粉毛妹子", Name1="高翠兰变色", propertyType=1, grade=1, star=0, level=1, hp=90, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241003, activeNeedItem="", des="海市蜃楼的地头蛇之一。", icon="items/godWill/411003.png", spineName="spine/god/411011_gaocuilan"}, 
[411012]={ id=411012, name="五庄道童", Name1="清风明月变色", propertyType=1, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=241006, activeNeedItem="", des="看守五庄观的一对呆萌小仙童。乃是人参果修炼成精，天生灵力强大。但毕竟是植物所化，故而没有七情六欲，很难沟通。", icon="items/godWill/411006.png", spineName="spine/god/411012_qingfengmingyue"}, 
[412001]={ id=412001, name="仙童", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=242001, activeNeedItem="750010-30", des="洞天福地的散仙制造的量产型机关人仙童。有自主意识可以修炼成精，现在人界也随处可见。", icon="items/godWill/412001.png", spineName="spine/god/412001_xiantong"}, 
[412002]={ id=412002, name="仙猿", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=242002, activeNeedItem="", des="原产洞天福地的猿猴。性格顽劣，繁殖力强，迅速成了散仙界的祸害，最终被散仙们驱逐出境迁移到了人界。", icon="items/godWill/412002.png", spineName="spine/god/412002_xianyuan"}, 
[412003]={ id=412003, name="土地", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=242003, activeNeedItem="750012-30", des="数量多到天庭都统计不过来的最低级神仙。几乎都很胆小怕事。但拥有一种强大的防御法术，无论遇到多强的妖怪，都可自保。", icon="items/godWill/412003.png", spineName="spine/god/412003_tudi"}, 
[412004]={ id=412004, name="沙悟净", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=242004, activeNeedItem="750013-30", des="唐僧的三徒弟，取经人之一。原是天庭的卷帘大将，一直保持着做大将时的军人式生活习惯。为人老实，可谓天下第一老实人。", icon="items/godWill/412004.png", spineName="spine/god/412004_shawujing"}, 
[412005]={ id=412005, name="猪八戒", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=242005, activeNeedItem="750014-30", des="唐僧的二徒弟，取经人之一。原是天庭的天蓬元帅，下凡时错投猪胎。其实真身是三界罕见的美男子，取得真经之后恢复了人形。", icon="items/godWill/412005.png", spineName="spine/god/412005_bajie"}, 
[412006]={ id=412006, name="女儿国王", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=3, cdTime=70000, skillID=242006, activeNeedItem="750015-30", des="贵为一国之君的绝世美女。对唐僧一见钟情，为了追求唐僧开始修道。但因为选了无法驾驭的飞宝遭到反噬，导致性情大变。", icon="items/godWill/412006.png", spineName="spine/god/412006_nverguowang"}, 
[412007]={ id=412007, name="金角银角", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=1000, needAngry=2, cdTime=70000, skillID=242007, activeNeedItem="750016-30", des="被太上老君宠坏的一对熊孩子仙童。缺乏教养，无法无天。经常趁老君闭关偷下界玩耍四处祸害，在三界内恶名远扬。", icon="items/godWill/412007.png", spineName="spine/god/412007_jinjiaoyinjiao"}, 
[412008]={ id=412008, name="哪吒", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=20, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=242008, activeNeedItem="750017-30", des="标准的官二代。看似和善实际非常高傲。财大气粗，一身极品法宝，面对比自己的强的对手也可以靠法宝压制，真正意义的神豪。", icon="items/godWill/412008.png", spineName="spine/god/412008_nezha"}, 
[412009]={ id=412009, name="铁扇公主", Name1="", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=60, needAngry=2, cdTime=70000, skillID=242009, activeNeedItem="750018-30", des="牛魔王的发妻，性格泼辣豪爽，不拘小节。虽然因为玉面狐狸的事曾和牛魔王长期分居，但现在已经不计前嫌，夫妻和睦。", icon="items/godWill/412009.png", spineName="spine/god/412009_tieshangongzhu"}, 
