[412020]={ id=412020, name="土地首领", Name1="土地变色2", propertyType=2, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=242003, activeNeedItem="", des="数量多到天庭都统计不过来的最低级神仙。几乎都很胆小怕事。但拥有一种强大的防御法术，无论遇到多强的妖怪，都可自保。", icon="items/godWill/412003.png", spineName="spine/god/412020_tudi"}, 
[413001]={ id=413001, name="猪妖", Name1="", propertyType=3, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=243001, activeNeedItem="750025-30", des="人界常见的小妖。智力较低，很难修成正果。有趣的是，很多猪妖把猪八戒奉为祖师爷，甚至自称猪八戒后代。", icon="items/godWill/413001.png", spineName="spine/god/413001_zhujing"}, 
[413002]={ id=413002, name="虾兵", Name1="", propertyType=3, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=243002, activeNeedItem="", des="水里常见的小妖，有河虾，海虾之分。多出没于水边，也能上岸作战，但时间久了可能会缺水变成虾干。去掉头的话味道极其鲜美。", icon="items/godWill/413002.png", spineName="spine/god/413002_xiabing"}, 
[413003]={ id=413003, name="猴小六", Name1="", propertyType=3, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=243003, activeNeedItem="750027-30", des="自幼和主角玩耍的小猴子。牙尖嘴利，知道很多稀奇古怪的事。自称祖籍花果山，因为喜欢吃仙桃村的桃子移居至此。真实年龄是个谜团。", icon="items/godWill/413003.png", spineName="spine/god/413003_xiaohou"}, 
[413004]={ id=413004, name="阿三", Name1="", propertyType=3, grade=1, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=120, needAngry=2, cdTime=70000, skillID=243004, activeNeedItem="750028-30", des="十分神秘的和尚，行踪飘忽不定，经常突然出现，突然消失。虽然总是一脸人畜无害的亲切微笑，但总觉得是个危险人物。", icon="items/godWill/413004.png", spineName="spine/god/413004_tangseng"}, 
[413005]={ id=413005, name="老鼠精", Name1="", propertyType=3, grade=2, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=80000, skillID=243005, activeNeedItem="750029-30", des="托塔天王的义女，哪吒的义妹。被孙悟空在教训过后变的十分低调。现在专注修道和侍奉哪吒父子，一心只盼能靠这层关系早日位列仙班。", icon="items/godWill/413005.png", spineName="spine/god/413005_laoshujing"}, 
[413006]={ id=413006, name="牛魔王", Name1="", propertyType=3, grade=2, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=70, needAngry=2, cdTime=70000, skillID=243006, activeNeedItem="750030-30", des="孙悟空的结义大哥。性格十分豪迈的壮汉，也是个武痴。对各种拳法颇有心得。只是对修炼不太热心，否则凭他的道行早就可修成正果。", icon="items/godWill/413006.png", spineName="spine/god/413006_niumowang"}, 
[413007]={ id=413007, name="红孩儿", Name1="", propertyType=3, grade=3, star=0, level=1, hp=30, atk=30, hurtY=100, hurtX=100, needAngry=2, cdTime=70000, skillID=243007, activeNeedItem="750031-30", des="牛魔王和铁扇公主的爱子。智商高达250的天才少年，一出生就备受三界瞩目。取经时终于被须弥山找到机会收入观音座下，封为善财童子。", icon="items/godWill/413007.png", spineName="spine/god/413007_honghaier"}, 
